// network-prefix        = global-network-prefix / local-network-prefix
// global-network-prefix = "+" 1*phonedigit
// local-network-prefix  = 1*(phonedigit / dtmf-digit / pause-character)
// private-prefix        = (%x21-22 / %x24-27 / %x2C / %x2F / %x3A /
